import React from "react";
import ImagesresH from "./ImagesresH";
const Catogreis = () => {
  const FilterCatogries = ["All", "Photos", "illustration", "vectors"];
let num = 0;
  return (
    <>
      <div className="filter-catogries">
        {FilterCatogries.map((filter) => {
          return (
            <>
              <div
                className="filter-cat-name "
                onClick={() => () => FilterCategries(filter)}
              >
                {filter}
              </div>
            </>
          );
        })}
      </div>
      <ImagesresH FilterCat={FilterCategries}/>
    </>
  );
};

export default Catogreis;
